import React, { Component } from 'react';

class Header extends Component {
  render() {
    return (
      <div>
        <p id="welcome">Welcome</p>
            <img src="./santa.png" alt="santa"/>
            <p>To The Polish Campout</p>
            <p>Kris Kringle 2019</p>
      </div>
    );
  }
}


export default Header;
